import './index.scss'
import backgroundimage from '../../assets/images/backgrnd-image2.png'

const Home = () =>{

    return (
        <div className="container-home-page">
            <div className="text-zone">
                <img src={backgroundimage} alt="bkrndimage" />
                <h1>I'm Srinidhi</h1>

            </div>

        </div>
    );
}
export default Home;
